import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ProfilePopup.css';

const ProfilePopup = ({ onClose }) => {
  const navigate = useNavigate();

  const handleProfileClick = () => {
    onClose(); // Close the popup
    navigate('/profile'); // Navigate to profile page
  };

  return (
    <div className="profile-popup">
      <div className="profile-header">
        <div className="profile-avatar">A</div>
        <h3 className="profile-name">ahliyah</h3>
        <button className="close-btn" onClick={onClose}>×</button>
      </div>
      <div className="profile-menu">
        <button className="menu-item" onClick={handleProfileClick}>
          View full profile
        </button>
        <button onClick={() => navigate('/settings')}>Settings</button>
        <button onClick={() => navigate('/feedback')}>Give feedback</button>
        <button onClick={() => navigate('/help')}>Get help</button>
        <div className="status">
          <span className="status-dot"></span>
          <span>Offline</span>
        </div>
        <button className="sign-out" onClick={() => navigate('/signup')}>Sign out</button>
      </div>
      <div className="footer-links">
        <a href="/terms">Terms & Conditions</a>
        <a href="/privacy">Privacy Policy</a>
        <a href="/cookie">Cookie Policy</a>
      </div>
      <div className="copyright">
        © 2024 TECHSELL
      </div>
    </div>
  );
};

export default ProfilePopup;
